// src/hooks/useArmouryData.js
import { useState, useEffect } from "react";

export default function useArmouryData(type) {
  const [data, setData] = useState([]);
  useEffect(() => {
    // Enhanced armoury data with detailed specifications
    const dataMap = {
      rifles: [
        { name: "AK-47", caliber: "7.62mm", category: "Assault Rifle", image: "/images/AK-47.webp", range: "400m", fireRate: "600 RPM", magazine: "30 rounds", damage: "High", price: "$1,200" },
        { name: "M4 Carbine", caliber: "5.56mm", category: "Assault Rifle", image: "/images/m4-carbine.jpg", range: "500m", fireRate: "700-950 RPM", magazine: "30 rounds", damage: "Medium", price: "$1,800" },
        { name: "HK416", caliber: "5.56mm", category: "Assault Rifle", image: "/images/hk416.jpg", range: "600m", fireRate: "700-900 RPM", magazine: "30 rounds", damage: "Medium", price: "$2,500" },
        { name: "SCAR-L", caliber: "5.56mm", category: "Assault Rifle", image: "/images/scar-l.jpg", range: "600m", fireRate: "550-650 RPM", magazine: "30 rounds", damage: "Medium", price: "$2,800" },
        { name: "AK-12", caliber: "5.45mm / 7.62mm", category: "Assault Rifle", image: "/images/ak12.jpg", range: "800m", fireRate: "600-700 RPM", magazine: "30 rounds", damage: "High", price: "$1,500" },
        { name: "Widow Maker", caliber: ".50 BMG", category: "Sniper Rifle", image: "/images/Widow-Maker sniper.jpg", range: "2000m", fireRate: "Semi-auto", magazine: "10 rounds", damage: "Extreme", price: "$8,500" },
        { name: "AWP", caliber: ".338 Lapua Magnum", category: "Sniper Rifle", image: "/images/awp.jpg", range: "1500m", fireRate: "Bolt-action", magazine: "5 rounds", damage: "Extreme", price: "$6,000" },
        { name: "Dragunov SVD", caliber: "7.62×54mmR", category: "Sniper Rifle", image: "/images/svd.jpg", range: "800m", fireRate: "Semi-auto", magazine: "10 rounds", damage: "High", price: "$3,500" },
        { name: "MK14 EBR", caliber: "7.62×51mm NATO", category: "DMR", image: "/images/mk14.jpg", range: "800m", fireRate: "Semi-auto", magazine: "20 rounds", damage: "High", price: "$4,200" },
        { name: "SKS", caliber: "7.62×39mm", category: "DMR", image: "/images/sks.jpg", range: "400m", fireRate: "Semi-auto", magazine: "10 rounds", damage: "Medium", price: "$800" },
        { name: "MP5", caliber: "9×19mm Parabellum", category: "SMG", image: "/images/mp5.jpg", range: "200m", fireRate: "800 RPM", magazine: "30 rounds", damage: "Low", price: "$2,200" },
        { name: "UMP-45", caliber: ".45 ACP", category: "SMG", image: "/images/ump45.jpg", range: "100m", fireRate: "600 RPM", magazine: "25 rounds", damage: "Medium", price: "$1,800" },
        { name: "P90", caliber: "5.7×28mm", category: "SMG", image: "/images/p90.jpg", range: "200m", fireRate: "900 RPM", magazine: "50 rounds", damage: "Low", price: "$2,400" },
        { name: "Vector", caliber: ".45 ACP / 9mm", category: "SMG", image: "/images/vector.jpg", range: "100m", fireRate: "1200 RPM", magazine: "25 rounds", damage: "Medium", price: "$2,600" },
      ],
      pistols: [
        { name: "Glock 17", caliber: "9mm" },
        { name: "Desert Eagle", caliber: ".50 AE" },
      ],
      protectionKits: [
        {
          name: "Death's Kevlar Vest",
          protection: "Level IIIA+",
          image: "/images/death-kevlar-vest.webp",
          level: "DEATH",
          material: "Reinforced Kevlar + Steel Plates",
          weight: "3.2kg",
          special: "Blood-stained from Death's previous victims. Enhanced with demonic runes for extra protection."
        },
        {
          name: "Skull Crusher Helmet",
          protection: "Level IIIA",
          image: "/images/skull-helmet.webp",
          level: "SKULL",
          material: "Ballistic Steel + Titanium",
          weight: "1.8kg",
          special: "Features skull engravings that strike fear into enemies. Night vision compatible."
        },
        {
          name: "Death's Shadow Armor",
          protection: "Level IV",
          image: "/images/shadow-armor.webp",
          level: "SHADOW",
          material: "Ceramic Plates + Kevlar Weave",
          weight: "4.5kg",
          special: "Black as Death's shadow. Makes wearer nearly invisible in darkness."
        },
        {
          name: "Blood Guard Shield",
          protection: "Level III+",
          image: "/images/blood-shield.webp",
          level: "GUARDIAN",
          material: "Reinforced Polymer + Steel Core",
          weight: "2.1kg",
          special: "Absorbs impact and channels Death's energy. Red glow intensifies under fire."
        },
        {
          name: "Demon Skin Suit",
          protection: "Level II+",
          image: "/images/demon-suit.webp",
          level: "DEMON",
          material: "Kevlar + Leather + Steel Mesh",
          weight: "2.8kg",
          special: "Flexible armor that moves like demonic skin. Resistant to blades and bullets."
        },
        {
          name: "Death's Final Guard",
          protection: "Level IV+",
          image: "/images/final-guard.webp",
          level: "FINAL",
          material: "Titanium + Ceramic + Kevlar",
          weight: "5.2kg",
          special: "Ultimate protection forged in Death's realm. Can stop armor-piercing rounds."
        }
      ],
      rpgBazuka: [
        { name: "RPG-7", caliber: "40mm" },
        { name: "Bazooka M1", caliber: "60mm" },
      ],
    };
    setData(dataMap[type] || []);
  }, [type]);
  return data;
}
